Return only created subdocument mongoose<p>I need to push a new document into an array and use his _id.</p>

<p>Right now im using findOneAndUpdate, i know i can use { new: true } but i only need the created document and not the parent document.</p>

<p>this is my code so far </p>

<pre><code>User.findOneAndUpdate(
    {
        'posts._id': req.params.id
    },
    {
        $push: {
            'posts.$.comments': {
                from: {
                    _id: req.user._id,
                    username: req.user.username,
                },
                body: req.body.commentBody
            }
        }
    },
    err =&gt; {
        if (err) console.log(err)
        // Do something with ObjectId
    }
);
</code></pre>

<p>Thanks in advance.</p>

