Average of Array Values by Position from a set of documents<p>I recently wrote a question which I have tried out but it has resulted in a different problem. <a href="https://stackoverflow.com/questions/49932287/sum-array-number-values-across-multiple-documents/49932466?noredirect=1#comment86880980_49932466">original question</a> and @NeilLunn helped me with working through the problem.</p>

<p>The script he created and I then modified for my use is below:</p>

<pre><code>db.getCollection('widget_documents').aggregate([
{ "$unwind": { "path": "$graph_data", "includeArrayIndex": "index" } },
{ "$group": {
"_id": {
  "group": "$displayname",
  "index": "$index"
},
"graph_data": { "$avg": "$graph_data.value" }
}},
{ "$sort": { "_id": 1 } },
{ "$group": {
  "_id": "$_id.group",
  "graph_data": { "$push": "$graph_data" }
}},
{ "$sort": { "_id": 1 } }  
])
</code></pre>

<p>It is supposed to unwind an array and then create the average of each of the comma separated values and keeping their same position. However, the values are all null which I cannot work out how to fix. See below results:</p>

